  constructor(props){
    super(props)
    this.state = {
      name:"Tavinho"
  }
}


render() {

    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            <p>Primeiro Projeto em React!</p>
          </p>
          <Tavinho></Tavinho>
        </header>

      </div>
    );
  }
}
